import React from "react";

function App() {
  return (
    <>
      <h2>Couple Album</h2>
      <form>
        <label htmlFor="image">Photo</label>
        <input id="image" type="file" />
        <button> Submit</button>
      </form>
    </>
  );
}

export default App;
